import React from 'react';

const Descriptor = ({ name, checked, onChange, params }) => {
    return (
        <div>
            <label>
                <input 
                    type="checkbox" 
                    name={name} 
                    checked={checked} 
                    onChange={onChange} 
                />
                {name}
            </label>
            {/* Mostrar inputs si el descriptor tiene parámetros */}
            {params.length > 0 && checked && (
                <div>
                    {params.map((param, index) => (
                        <div key={index}>
                            <label>{param.label}:</label>
                            <input 
                                type="text" 
                                name={param.name} 
                                onChange={param.onChange} // Podrías usar un método para capturar los valores
                            />
                        </div>
                    ))}
                </div>
            )}
        </div>
    );
};


export default Descriptor;
